B.aka=new A.e("There are far more positions than you'd think in which a Pawn in hand makes a big difference. Look at Diagram 1-1.")
B.N9=new A.o("7nl/5bgk1/5g1pp/4ppp2/7NP/4PB3/5P3/7R1/8L b P","Diagram 1-1")
B.amy=new A.e("White has formed a usual Yagura castle less one Silver. With Black's Knight on 2e, a Pawn drop on 3c will be quite effective. If you have a Pawn in hand, that is. Thus, a Pawn in hand could be compared to a thousand Gold pieces.")
B.a0_=s(["P*3c","Nx3c","Nx1c+"],t.s)
B.l=new A.TO(0,"sente")
B.abb=new A.Q("The most likely moves to follow are:",B.a0_,B.l)
B.aoC=new A.e("After Black's P*3c, White could play G-3a, but that would leave bad shape for White. So, Nx3c is a natural move, avoiding loss of material. Note the next move: Nx1c+. In the wrong direction, you say? No, this is right.")
B.YD=s(["Lx1c","P-1d","Lx1d","Lx1d"],t.s)
B.v=new A.TO(1,"gote")
B.aay=new A.Q("There will follow:",B.YD,B.v)
B.aj1=new A.e("By following the natural moves, Black will have a breakthrough along the first file.")
B.ajw=new A.e("Back at the Diagram 1-1, if you have more than one Pawn, you could also play as follows:")
B.a_h=s(["P*3c","Nx3c","Nx3c+","G4c-3c","N*2e","G3c-4c","P*3c"],t.s)
B.abf=new A.Q(null,B.a_h,B.l)
B.aok=new A.e("When your opponent has formed a yagura castle, make sure you have at least one Pawn in hand before playing N-2e.")
B.a1z=s([B.aka,B.N9,B.amy,B.abb,B.aoC,B.aay,B.aj1,B.ajw,B.abf,B.aok],t.A)
B.ael=new A.av(B.a1z)
B.alO=new A.e("Diagram 2-1 (up to Px2d) shows where White played Px2d after Black's P-2d. Now what will be the next move using a Pawn in hand to attack White's yagura castle?")
B.Qm=new A.o("7nl/5bgk1/5gs1p/4pppp1/8P/4PBP2/5PN2/7R1/8L b Pp","Diagram 2-1")
B.agY=new A.e("P*2e is the move you should remember. When playing double fortress opening (both sides play the yagura castle), a joining-Pawn tesuji (to drop a Pawn on the square just in front of an opposing Pawn with the goal of its being captured) can be quite effective when applied in the enemy's King file.")
B.anC=new A.e("To Black's P*2e, White cannot but respond by Px2e, otherwise Black will play Px2d and again a solid foothold so that he can next play Nx2e. This will be good for Black. Then White will have to play S-2d to prevent from loss of material, to which Black can reply Nx1c+.")
B.app=new A.e("  1) If White responds with Lx1c, Bx2d will do.\n  2) If Nx1c, again Bx2d will do the trick.\n  Either way, Black will be able to continue undermining the yagura camp.\n  3) If Kx1c, P*2e will be the most severe blow for White.\n  Remember, when the opponent's King gets in your Bishop's path, attack the interposing piece. This is one of the most important patterns.")
B.afP=new A.e("When playing yagura, most White players tend to play Sx2d instead of Px2d after Black's P-2d, thereby avoiding the joining-Pawn tesuji. This will give you an idea how effective the Pawn drop can be.")
B.a2n=s([B.alO,B.Qm,B.agY,B.anC,B.app,B.afP],t.A)
B.afL=new A.av(B.a2n)
B.Pq=new A.o("ln1g1R3/1ks6/pppp5/5B3/P8/1PP1P4/9/9/9 b Pp","Diagram 3-1")
B.agi=new A.e("Against the Mino-castle, on Diagram 3-1, where would you drop your Pawn?")
B.alB=new A.e("P*6b is the crucial move. If White plays G-5b, he will allow the Pawn to promote onto 6a. So he will have to play G-7a, only to meet:")
B.Xq=s(["Rx7a+","Kx7a","P-6a+"],t.s)
B.acp=new A.Q(null,B.Xq,B.l)
B.alF=new A.e("Rx7a+ is the decisive move. White has no choice but to play Kx7a. Then you go on to play P-6a+, double checkmate! White's King will be forced to mate whatever he may play.")
B.alT=new A.e("If you cannot drop your Pawn along the 6th file, check if you can on the 5th file. P*5b will also be a very effective move (Diagram 3-2).")
B.OH=new A.o("ln1g1R3/1ks1P4/pppp5/5B3/P8/1PP6/9/9/9 w p","Diagram 3-2")
B.agv=new A.e("You will then promote the Pawn on 6a, against which White will play G-7a, then you pull the tokin back to 5b. The Mino-castle is sure to fall.")
B.ao7=new A.e("What if White plays Gx5b at Diagram 3-2? You know it. R-7a+ will lead to exactly the same position as above.")
B.aiG=new A.e("If you are thinking of playing P*5c instead of P*5b, you should remember White's P*5a will turn the table around.")
B.ah1=new A.e("When playing against the Mino-castle, attack the Gold on 6a. This is the golden rule.")
B.Vr=s([B.Pq,B.agi,B.alB,B.acp,B.alF,B.alT,B.OH,B.agv,B.ao7,B.aiG,B.ah1],t.A)
B.afo=new A.av(B.Vr)
B.aoM=new A.e("Sometimes a Pawn in hand could decide a game. Look at Diagram 4-1 (last move R-3b). Black played Px2d, to which White played R-3b, inadvertently giving Black a windfall.")
B.Qa=new A.o("ln1g3n1/1ks3rbl/1p1g5/p1ppppsRp/6p2/P1P1PP2P/1P1PS4/1BKGGS3/LN5NL b P2p","Diagram 4-1")
B.WR=s(["P*3c"],t.s)
B.aai=new A.Q(null,B.WR,B.l)
B.aoR=new A.e("This is called a focal point Pawn drop.")
B.aob=new A.e("The square in question is guarded by three White pieces. See for yourself that White cannot save himself from loss of the material whichever way he may respond.")
B.akC=new A.e("Diagram 4-2 (last move Px2d) also shows how devastating a focal point Pawn drop can be.")
B.MH=new A.o("ln1gbr1n1/1ks5l/1p1g5/p1pppsppp/5p3/P1P1P1P1P/1P1PS1N2/1BKGGS1R1/LN6L b Pp","Diagram 4-2")
B.a4_=s(["P*4b"],t.s)
B.acP=new A.Q(null,B.a4_,B.l)
B.amH=new A.e("If Bx4b, Black can play Bx4d gaining the Silver for free. If Rx4b, Black can play Rx2d.")
B.ao3=new A.e("When you drop a Pawn in the square where more than one piece is in defense, it should block one of them, thereby undermining the whole defense.")
B.UC=s([B.aoM,B.Qa,B.aai,B.aoR,B.aob,B.akC,B.MH,B.acP,B.amH,B.ao3],t.A)
B.aeC=new A.av(B.UC)
B.agJ=new A.e("Diagram 5-1 (last move G-6c) shows where a static-Rook versus ranging-Rook game gets into the mid-stage. Note that Black's Pawn along the 4th file is missing from the board, and is in hand instead. This is a solid advantage for Black, giving him an opportunity to put the proverb to good use.")
B.O_=new A.o("ln1g1r1nl/1ks6/1p1g2bp1/p1pppsp1p/5p1P1/P1P1P1P1P/1P1PS4/1BKGGS1R1/LN5NL b P","Diagram 5-1")
B.Zt=s(["P-2d","Px2d","P*2b"],t.s)
B.ac0=new A.Q("Moves after Diagram 5-1:",B.Zt,B.l)
B.akk=new A.e("Since he has a Pawn in hand, Black can begin his attack on the 2nd file by P-2d. If White plays Bx2b after P*2b, Black can play Rx2d, a favorable turn for Black.")
B.anD=new A.e("If White does not respond to P*2b and play something else, Black can play Px2a+, taking the Knight and then the Lance for free. If, after Diagram 5-1, White plays Bx2d in response to P-2d, P*2b will still be a good move. After White plays N-3c, Black's P-2a+ will follow. White cannot take the promoted Pawn, for the Silver on 4d will be taken for free.")
B.aib=new A.e('Suppose White plays something elsewhere, how would you as Black play next? +Px1a? That wouldn\'t be a bad idea, but there is an even better move. +P-2b and then +Px2c will be more devastating to the opponent. This line of moves is what we call "authentic line"')
